import React from "react";
import { View, Image, Text, ScrollView, Alert } from "react-native";
import { FontAwesome } from "@expo/vector-icons";
import IconButton from "../../../components/IconButton";
import { SvgXml } from "react-native-svg";
import { changeAppointment } from "../../../Class/appointment";
import { useSelector } from "react-redux";
import { Color } from "../../../assets/colors";
import { ActivityIndicator } from "react-native-paper";
import { changeTime } from "../../../action";
import { SafeAreaView } from "moti";

export default function UserAppointmentDetails({ navigation, route }) {
  const [image, setImage] = React.useState();
  const data = route.params && route.params.data ? route.params.data : null;
  const appointment =
    route.params && route.params.appointment ? route.params.appointment : null;
  const user = useSelector((state) => state.user);
  const [Loader, setLoader] = React.useState(false);
  const isDark = useSelector((state) => state.isDark);
  const colors = new Color(isDark);
  const backgroundColor = colors.getBackgroundColor();
  //console.log(data)

  if (Loader) {
    return (
      <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
        <ActivityIndicator size={"small"} color={backgroundColor} />
      </View>
    );
  }
  return (
    <SafeAreaView style={{ flex: 1 }}>
      <ScrollView>
        <View
          style={{
            paddingHorizontal: 20,
            paddingVertical: 20,
            flexDirection: "row",
          }}>
          <View
            style={{
              borderWidth: 0.5,
              borderColor: "#707070",
              width: 60,
              height: 60,
              borderRadius: 30,
              justifyContent: "center",
              alignItems: "center",
              overflow: "hidden",
            }}>
            {data && data.service.profilePhoto ? (
              <Image
                style={{
                  height: 60,
                  width: 60,
                }}
                source={{ uri: data.service.profilePhoto }}
              />
            ) : (
              <FontAwesome name="user" size={45} color="black" />
            )}
          </View>
          <View
            style={{
              marginLeft: 20,
            }}>
            <Text
              style={{
                fontSize: 16,
                fontFamily: "Poppins-SemiBold",
                lineHeight: 22,
              }}>
              {data && data.service.serviceCenterName
                ? data.service.serviceCenterName
                : "Invalid"}
            </Text>
            <Text
              style={{
                fontSize: 14,
                fontFamily: "Poppins-SemiBold",
                lineHeight: 18,
              }}>
              {data && data.service.providerInfo.title
                ? `${data.service.providerInfo.title} `
                : "--"}
              {data && data.service.providerInfo.name
                ? data.service.providerInfo.name
                : "Invalid"}
              {` (${
                data && data.service.providerInfo.gender
                  ? data.service.providerInfo.gender.toUpperCase()
                  : "Invalid"
              })`}
            </Text>
            <Text
              style={{
                fontSize: 12,
              }}>
              Position of{" "}
              {data && data.service.providerInfo.position
                ? data.service.providerInfo.position
                : "Invalid"}
            </Text>
          </View>
        </View>
        <View
          style={{
            paddingHorizontal: 20,
          }}>
          <Text
            style={{
              fontSize: 14,
              fontFamily: "Poppins-Medium",
            }}>
            {data ? data.date : "Invalid"}
            {"    "}
            {data ? changeTime(data.startTime) : "Invalid"}
            {" - "}
            {data ? changeTime(data.endTime) : "Invalid"}
          </Text>
          <Text
            style={{
              fontSize: 18,
              fontFamily: "Poppins-SemiBold",
              marginTop: 20,
            }}>
            {data ? data.title : "Invalid"}
          </Text>
          <Text
            style={{
              fontSize: 14,
              marginTop: 15,
              textAlign: "justify",
            }}>
            {data && data.description ? data.description : "N/A"}
          </Text>
        </View>
        {data && data.status == "CANCELLED" && (
            <Text
              style={{
                color: "#DA1E37",
                textAlign: "center",
                marginVertical: 40,
              }}>
              Cancelled
            </Text>
          )}
          {data && data.status == "COMPLETED" && (
            <Text
              style={{
                color: "#4ADE80",
                textAlign: "center",
                marginVertical: 40,
              }}>
              Completed
            </Text>
          )}
          {data && data.status == "APPROVED" && (
            <Text
              style={{
                color: "#4ADE80",
                textAlign: "center",
                marginVertical: 40,
              }}>
              Approved
            </Text>
          )}
          {data && data.status == "REJECTED" && (
            <Text
              style={{
                color: "red",
                textAlign: "center",
                marginVertical: 40,
              }}>
              Rejected
            </Text>
          )}
      </ScrollView>

      {data &&
        data.status != "CANCELLED" &&
        data.status != "COMPLETED" &&
        data.status != "REJECTED" && (
          <View
            style={{
              flexDirection: "row",
              paddingHorizontal: 20,
              paddingVertical: 30,
              justifyContent: "center",
              alignItems: "center",
              
            }}>
            {data && data.status == "PENDING" && (
              <IconButton
                onPress={() => {
                  if (!data) {
                    Alert.alert("Opps", "Something went wrong");
                    return;
                  }
                  setLoader(true);
                  changeAppointment(user.token, data.id, "APPROVED")
                    .then((res) => {
                      setLoader(false);
                      navigation.goBack();
                    })
                    .catch((err) => {
                      setLoader(false);

                      Alert.alert("Error", err.response.data.msg);
                    });
                }}
                style={{
                  color: "#4BAE4F",
                  height: 40,
                }}
                LeftIcon={() => (
                  <SvgXml xml={accept} width="20" height={"20"} />
                )}
                title="Accept Appointment"
              />
            )}
            {data && data.status == "APPROVED" && (
              <IconButton
                onPress={() => {
                  if (!data) {
                    Alert.alert("Opps", "Something went wrong");
                    return;
                  }
                  setLoader(true);
                  changeAppointment(user.token, data.id, "COMPLETED")
                    .then((res) => {
                      setLoader(false);
                      navigation.goBack();
                    })
                    .catch((err) => {
                      setLoader(false);

                      Alert.alert("Error", err.response.data.msg);
                    });
                }}
                style={{
                  color: "#4BAE4F",
                  height: 40,
                }}
                LeftIcon={() => (
                  <SvgXml xml={accept} width="20" height={"20"} />
                )}
                title="Complete Appointment"
              />
            )}
            {/* {data && data.status == "PENDING" && (
              <Text
                style={{
                  fontSize: 16,
                  fontFamily: "Poppins-Medium",
                  color: "#6366F1",
                }}
              >
                Request Pending
              </Text>
            )} */}
            <View style={{ width: 10 }} />
            <IconButton
              onPress={() => {
                if (!data) {
                  Alert.alert("Opps", "Something went wrong");
                  return;
                }
                setLoader(true);
                changeAppointment(user.token, data.id, "CANCELLED")
                  .then((res) => {
                    setLoader(false);
                    navigation.goBack();
                  })
                  .catch((err) => {
                    setLoader(false);

                    Alert.alert("Error", err.response.data.msg);
                  });
              }}
              style={{
                color: "#DA1E37",
                height: 40,
              }}
              LeftIcon={() => <SvgXml xml={cancel} width="20" height={"20"} />}
              title="Cancel Appointment"
            />
          </View>
        )}
    </SafeAreaView>
  );
}
const cancel = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="14" height="14" viewBox="0 0 14 14">
<image id="NoPath_-_Copy_17_" data-name="NoPath - Copy (17)" width="14" height="14" xlink:href="data:image/png;base64,"/>
</svg>
`;

const accept = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="13" height="13" viewBox="0 0 13 13">
<image id="NoPath_-_Copy_16_" data-name="NoPath - Copy (16)" width="13" height="13" xlink:href="data:image/png;base64,"/>
</svg>
`;
